import React from 'react';

const AddDivision = (props) => {
    return(
        <div > 
            <h1>Nouvelle Division</h1>
            <form>
                <label> Nom </label>
                <input type="text" placeholder="" /> 
            </form>
        </div>
    )
}

export default AddDivision;
